// UserTable.js
import React, { useState } from 'react';
import { useSelector, useDispatch } from 'react-redux';
import { deleteUser, editUser } from '../store/UserSlice';
import { useFormik } from 'formik';
import * as Yup from 'yup';
import '../styles/UserTable.css'; // Importing the styles file

const UserTable = () => {
  const users = useSelector((state) => state.users);
  const dispatch = useDispatch();
  const [editMode, setEditMode] = useState(false);
  const [editedUser, setEditedUser] = useState(null);

  const handleDelete = (id) => {
    dispatch(deleteUser(id));
  };

  const handleEdit = (user) => {
    setEditedUser(user);
    setEditMode(true);
  };

  const formik = useFormik({
    initialValues: {
      firstName: editedUser ? editedUser.firstName : '',
      lastName: editedUser ? editedUser.lastName : '',
      age: editedUser ? editedUser.age : '',
      cnic: editedUser ? editedUser.cnic : ''
    },
    validationSchema: Yup.object({
      firstName: Yup.string().required('Required'),
      lastName: Yup.string().required('Required'),
      age: Yup.number().required('Required').positive('Must be positive').integer('Must be an integer'),
      cnic: Yup.string().required('Required').matches(/^\d{5}-\d{7}-\d$/, 'Invalid CNIC format (xxxxx-xxxxxxx-x)')
    }),
    onSubmit: (values) => {
      dispatch(editUser({ id: editedUser.id, updatedUser: values }));
      setEditedUser(null);
      setEditMode(false);
    }
  });

  return (
    <div className="user-table-container">
      <table className="user-table">
        <thead>
          <tr>
            <th>First Name</th>
            <th>Last Name</th>
            <th>Age</th>
            <th>CNIC</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {users?.users?.map((user) => (
            <tr key={user.id}>
              <td>{user.firstName}</td>
              <td>{user.lastName}</td>
              <td>{user.age}</td>
              <td>{user.cnic}</td>
              <td className='ED'>
                <button onClick={() => handleEdit(user)}>Edit</button>
                <button onClick={() => handleDelete(user.id)}>Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>

      {editMode && (
        <div className="modal">
          <div className="modal-content">
            <span className="close" onClick={() => setEditMode(false)}>&times;</span>
            <h2>Edit User</h2>
            <form onSubmit={formik.handleSubmit}>
              <input
                type="text"
                name="firstName"
                value={formik.values.firstName}
                onChange={formik.handleChange}
                onBlur={formik.handleBlur}
                placeholder="First Name"
              />
              {formik.touched.firstName && formik.errors.firstName ? (
                <div className="error">{formik.errors.firstName}</div>
              ) : null}

              <input
                type="text"
                name="lastName"
                value={formik.values.lastName}
                onChange={formik.handleChange}
                onBlur={formik.handleBlur}
                placeholder="Last Name"
              />
              {formik.touched.lastName && formik.errors.lastName ? (
                <div className="error">{formik.errors.lastName}</div>
              ) : null}

              <input
                type="number"
                name="age"
                value={formik.values.age}
                onChange={formik.handleChange}
                onBlur={formik.handleBlur}
                placeholder="Age"
              />
              {formik.touched.age && formik.errors.age ? (
                <div className="error">{formik.errors.age}</div>
              ) : null}

              <input
                type="text"
                name="cnic"
                value={formik.values.cnic}
                onChange={formik.handleChange}
                onBlur={formik.handleBlur}
                placeholder="CNIC (xxxxx-xxxxxxx-x)"
              />
              {formik.touched.cnic && formik.errors.cnic ? (
                <div className="error">{formik.errors.cnic}</div>
              ) : null}

              <button type="submit">Save</button>
            </form>
          </div>
        </div>
      )}
    </div>
  );
};

export default UserTable;
